import { Link } from "react-router-dom";
import styles from "./Events.module.css";
import useHttp from "../components/hooks/response-hook";

const { isLoading, error, sendRequest } = useHttp();

const EventsPage = () => {
  const EVENTSLIST = [
    { id: "e1", title: "event one" },
    { id: "e2", title: "event two" },
    { id: "e3", title: "event three" },
    { id: "e4", title: "event four" },
    { id: "e5", title: "event five" },
  ];

  const eventList = EVENTSLIST.map((event) => (
    <li key={event.id}>
      <Link className={styles["events__link"]} to={event.id}>
        {event.title}
      </Link>
    </li>
  ));

  return (
    <>
      <h1>Events</h1>
      <ul className={styles["events__list"]}>{eventList}</ul>
    </>
  );
};

export default EventsPage;
